ic1t_1 = - (sin(t*w1)*(q4*w1^4 - q2*w1^2 + q0))/(2*w1*(w1 + w2)*(w1 + w3)*(w1 + w4)*(w1 - w2)*(w1 - w3)*(w1 - w4));
ic1t_2 = (sin(t*w2)*(q4*w2^4 - q2*w2^2 + q0))/(2*w2*(w1 + w2)*(w2 + w3)*(w2 + w4)*(w1 - w2)*(w2 - w3)*(w2 - w4));
ic1t_3 = - (sin(t*w3)*(q4*w3^4 - q2*w3^2 + q0))/(2*w3*(w1 + w3)*(w2 + w3)*(w3 + w4)*(w1 - w3)*(w2 - w3)*(w3 - w4));
ic1t_4 = (sin(t*w4)*(q4*w4^4 - q2*w4^2 + q0))/(2*w4*(w1 + w4)*(w2 + w4)*(w3 + w4)*(w1 - w4)*(w2 - w4)*(w3 - w4));


% We can insert Idc and write ic1(t) in a more compact format, which yields:
q2 = w2dc2 + 2*wa2 + wdc1 + wdc2;
q0 = w2dc2*(wa2 + wdc1 + wdc2 - 1/w1dc1*wa2*wdc1) + wa2*(2*wdc1 + wdc2);

ic1t_1 = (sin(t*w1)*Vdc/(Cb1*La1*Ldc1)*(w1^4 - q2*w1^2 + q0))/(2*w1*(w2^2 - w1^2)*(w3^2 - w1^2)*(w4^2 - w1^2));
ic1t_2 = (sin(t*w2)*Vdc/(Cb1*La1*Ldc1)*(w2^4 - q2*w2^2 + q0))/(2*w2*(w1^2 - w2^2)*(w3^2 - w2^2)*(w4^2 - w2^2));
ic1t_3 = (sin(t*w3)*Vdc/(Cb1*La1*Ldc1)*(w3^4 - q2*w3^2 + q0))/(2*w3*(w1^2 - w3^2)*(w2^2 - w3^2)*(w4^2 - w3^2));
ic1t_4 = (sin(t*w4)*Vdc/(Cb1*La1*Ldc1)*(w4^4 - q2*w4^2 + q0))/(2*w4*(w1^2 - w4^2)*(w2^2 - w4^2)*(w3^2 - w4^2));
% The final time domain expression for ic1(t) is:
ic1t = Idc + exp(-t*t1).*ic1t_1 + exp(-t*t2).*ic1t_2 + exp(-t*t3).*ic1t_3 + exp(-t*t4).*ic1t_4;


